import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';

class GoogleMap extends Component {
  render() {
    return (
      <React.Fragment>
        <Container className="mt-0 mt-60" fluid>
          <Row>
            <Col xs="12" className="p-0">
              <div className="map">
                <iframe
                  title="uniqueTitle"
                  src="https://www.google.com/maps/dir/42.0535276,-88.0536131/1054+National+Pkwy,+Schaumburg,+IL+60173/@42.0546019,-88.0555738,17z/data=!3m1!4b1!4m9!4m8!1m1!4e1!1m5!1m1!1s0x880faf78f715cf8d:0xcfc4f5a7c60b6fa4!2m2!1d-88.0529962!2d42.0550425"
                  style={{ border: '0' }}
                  allowFullScreen
                ></iframe>
              </div>
            </Col>
          </Row>
        </Container>
      </React.Fragment>
    );
  }
}

export default GoogleMap;
